INSERT INTO `recipes` VALUES (1,'Súp đậu lăng đỏ với thịt gà và củ cải','Súp đậu lăng đỏ với thịt gà và củ cải có thể là một công thức tốt để mở rộng tiết mục khóa học chính của bạn.Công thức này phục vụ 8 và chi phí $ 3,0 mỗi khẩu phần.Một phục vụ chứa <b> 477 calo </b>, <b> 27g protein </b> và <b> 20g chất béo </b>.Nó được mang đến cho bạn bằng màu hồng khi.1866 mọi người đã thử và thích công thức này.Nó có thể được thưởng thức bất cứ lúc nào, nhưng nó đặc biệt tốt cho <b> mùa thu </b>.Từ việc chuẩn bị đến tấm, công thức này mất khoảng <b> 55 phút </b>.Đó là một lựa chọn tốt nếu bạn đang theo chế độ ăn kiêng <b> không có gluten và không có sữa </b>.Đi đến cửa hàng và nhặt muối và hạt tiêu, cà chua đóng hộp, rau mùi tây phẳng, và một vài thứ khác để làm cho nó ngày hôm nay.Nhìn chung, công thức này kiếm được số điểm Spoonacular ngoạn mục là 99%</b>.Nếu bạn thích công thức này, bạn cũng có thể thích các công thức nấu ăn như <a href = \"https://spoonacular.com/recipes/red-lentil-and-chicken-soup-682185\"Súp gà </a>, và <a href = \"https://spoonacular.com/recipes/red-lentil-soup-34121\"> súp đỏ-lentil </a>.','https://img.spoonacular.com/recipes/715415-312x231.jpg'),(2,'Súp đậu lăng đỏ với thịt gà và củ cải','Súp đậu lăng đỏ với thịt gà và củ cải có thể là một công thức tốt để mở rộng tiết mục khóa học chính của bạn.Công thức này phục vụ 8 và chi phí $ 3,0 mỗi khẩu phần.Một phục vụ chứa <b> 477 calo </b>, <b> 27g protein </b> và <b> 20g chất béo </b>.Nó được mang đến cho bạn bằng màu hồng khi.1866 mọi người đã thử và thích công thức này.Nó có thể được thưởng thức bất cứ lúc nào, nhưng nó đặc biệt tốt cho <b> mùa thu </b>.Từ việc chuẩn bị đến tấm, công thức này mất khoảng <b> 55 phút </b>.Đó là một lựa chọn tốt nếu bạn đang theo chế độ ăn kiêng <b> không có gluten và không có sữa </b>.Đi đến cửa hàng và nhặt muối và hạt tiêu, cà chua đóng hộp, rau mùi tây phẳng, và một vài thứ khác để làm cho nó ngày hôm nay.Nhìn chung, công thức này kiếm được số điểm Spoonacular ngoạn mục là 99%</b>.Nếu bạn thích công thức này, bạn cũng có thể thích các công thức nấu ăn như <a href = \"https://spoonacular.com/recipes/red-lentil-and-chicken-soup-682185\"Súp gà </a>, và <a href = \"https://spoonacular.com/recipes/red-lentil-soup-34121\"> súp đỏ-lentil </a>.','https://img.spoonacular.com/recipes/715415-312x231.jpg'),(3,'Măng tây và Súp đậu: Thức ăn tiện lợi thực sự','Măng tây và súp đậu: Thực phẩm tiện lợi thực sự cần khoảng <b> 20 phút </b> từ đầu đến cuối.Xem hình của bạn?Công thức ăn chay không có gluten, không có sữa, Paleolithic và Lacto OVO này có <b> 217 calo </b>, <b> 11g protein </b> và <b> 8g chất béo </b> mỗi lần phục vụ.Công thức này phục vụ 2. Với <b> $ 1,78 mỗi lần phục vụ </b>, công thức này <b> bao gồm 25%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.<b> Autumn </b> sẽ còn đặc biệt hơn với công thức này.Nó hoạt động tốt như một hor d\'Oeuvre.207 người đã thử và thích công thức này.Nó được mang đến cho bạn bởi Fullbellysisters.blogspot.com.Một hỗn hợp của nước dùng rau, evoo, tỏi, và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này rất ngon.Tất cả những điều được xem xét, chúng tôi đã quyết định công thức này <b> xứng đáng có số điểm thì 96%</b>.Điểm này là nổi bật.Hãy thử <a href = \"https://spoonacular.com/recipes/asparagus-and-pea-soup-real-convenience-food-1393979\"> Súp măng tây và đậu: Thực phẩm tiện lợi thực sự </a>, <Ahref = \"https://spoonacular.com/recipes/asparagus-and-pea-soup-real-convenience-food-1376201\"> súp măng tây và đậu: thực phẩm tiện lợi thực sự </a>, và <ahref = \"https://spoonacular.com/recipes/asparagus-and-pea-soup-real-convenience-food-1362341\"> súp măng tây và đậu: thực phẩm tiện lợi thực sự </a> cho các công thức nấu ăn tương tự.','https://img.spoonacular.com/recipes/716406-312x231.jpg'),(4,'Kale garlicky','Kale garlicky cần khoảng <b> 45 phút </b> từ đầu đến cuối.Món phụ này có <b> 170 calo </b>, <b> 2g protein </b> và <b> 15g chất béo </b> mỗi lần phục vụ.Công thức này phục vụ 2. Với <b> 69 cent mỗi lần phục vụ </b>, công thức này <b> bao gồm 17%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.19 người đã thực hiện công thức này và sẽ làm lại.Công thức này từ Foodista đòi hỏi giấm balsamic, tỏi, cải xoăn xoăn và dầu ô liu.Đó là một lựa chọn tốt nếu bạn đang theo dõi một chế độ ăn chay <b> không có gluten, không có sữa, Paleolithic và Lacto ovo </b>.Với một thìa <b> điểm 99%</b>, món ăn này là nổi bật.Hãy thử <a href = \"https://spoonacular.com/recipes/garlicky-kale-248759\"> Garlicky Kale </a>, <a href = \"https://spoonacularhref = \"https://spoonacular.com/recipes/garlicky-kale-1584523\"> Kale garlicky </a> cho các công thức nấu ăn tương tự.','https://img.spoonacular.com/recipes/644387-312x231.jpg'),(5,'Slow Cooker Beef Stew','Nếu bạn muốn thêm các công thức nấu ăn <b> miễn phí và không có sữa </b> vào hộp công thức của bạn, món thịt bò nấu chậm có thể là một công thức bạn nên thử.Một phục vụ chứa <b> 434 calo </b>, <b> 44g protein </b> và <b> 12g chất béo </b>.Công thức này phục vụ 6 .. với <b> $ 2,7 mỗi lần phục vụ </b>, công thức này <b> bao gồm 45%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.Nó hoạt động tốt nhất như một khóa học chính, và được thực hiện trong khoảng <b> 8 giờ 10 phút </b>.Nếu bạn có hành lá, cà rốt, cần tây và một vài thành phần khác trong tay, bạn có thể làm nó.Công thức này được yêu thích bởi 57 foodies và đầu bếp.<b> Autumn </b> sẽ còn đặc biệt hơn với công thức này.Nó được mang đến cho bạn bằng màu hồng khi.Tính đến tất cả các yếu tố, công thức này <b> kiếm được số điểm thì 99%</b>, điều này thật tuyệt vời.Các công thức nấu ăn tương tự bao gồm <a href = \"https://spoonacular.com/recipes/slow-cooker-beef-stew-1578321\"> smef cooker stef Stew </a>, <a href = \"https://spoonacular.comhref = \"https://spoonacular.com/recipes/slow-cooker-beef-stew-1281171\"> Stow Cooker Beef Stew </a>.','https://img.spoonacular.com/recipes/715446-312x231.jpg'),(6,'Hậu đỏ bean jambalaya','Bean bean red jambalayan là một khóa học chính phục vụ 6. Một phần của đĩa này chứa xấp xỉ <b> 18g protein </b>, <b> 6g chất béo </b> và tổng cộng <b> 393 calo </b>.Đối với <b> $ 1,68 mỗi khẩu phần </b>, công thức này <b> bao gồm 33%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.53 người rất vui vì họ đã thử công thức này.Một hỗn hợp của rau, cà chua, hành tây và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này trở nên có hương vị.Đó là một lựa chọn tốt nếu bạn đang theo dõi <b> không có gluten, không có sữa, ăn chay lacto ovo và ăn chay </b>.Công thức này là điển hình của ẩm thực Cajun.Nó được mang đến cho bạn bởi foodandspice.blogspot.com.Từ việc chuẩn bị đến đĩa, công thức này mất khoảng <b> 45 phút </b>.Nhìn chung, công thức này kiếm được số điểm rất lớn <b> 99%</b>.Người dùng thích công thức này cũng thích <a href = \"https://spoonacular.com/recipes/red-kidney-bean-ambalaya-1407231\"Salad </a>, và <a href = \"https://spoonacular.com/recipes/red-kidney-bean-curry-80686\"> cà ri đậu đỏ </a>.','https://img.spoonacular.com/recipes/782601-312x231.jpg'),(7,'Súp đậu lăng đỏ với thịt gà và củ cải','Súp đậu lăng đỏ với thịt gà và củ cải có thể là một công thức tốt để mở rộng tiết mục khóa học chính của bạn.Công thức này phục vụ 8 và chi phí $ 3,0 mỗi khẩu phần.Một phục vụ chứa <b> 477 calo </b>, <b> 27g protein </b> và <b> 20g chất béo </b>.Nó được mang đến cho bạn bằng màu hồng khi.1866 mọi người đã thử và thích công thức này.Nó có thể được thưởng thức bất cứ lúc nào, nhưng nó đặc biệt tốt cho <b> mùa thu </b>.Từ việc chuẩn bị đến tấm, công thức này mất khoảng <b> 55 phút </b>.Đó là một lựa chọn tốt nếu bạn đang theo chế độ ăn kiêng <b> không có gluten và không có sữa </b>.Đi đến cửa hàng và nhặt muối và hạt tiêu, cà chua đóng hộp, rau mùi tây phẳng, và một vài thứ khác để làm cho nó ngày hôm nay.Nhìn chung, công thức này kiếm được số điểm Spoonacular ngoạn mục là 99%</b>.Nếu bạn thích công thức này, bạn cũng có thể thích các công thức nấu ăn như <a href = \"https://spoonacular.com/recipes/red-lentil-and-chicken-soup-682185\"Súp gà </a>, và <a href = \"https://spoonacular.com/recipes/red-lentil-soup-34121\"> súp đỏ-lentil </a>.','https://img.spoonacular.com/recipes/715415-312x231.jpg'),(8,'Măng tây và Súp đậu: Thức ăn tiện lợi thực sự','Măng tây và súp đậu: Thực phẩm tiện lợi thực sự cần khoảng <b> 20 phút </b> từ đầu đến cuối.Xem hình của bạn?Công thức ăn chay không có gluten, không có sữa, Paleolithic và Lacto OVO này có <b> 217 calo </b>, <b> 11g protein </b> và <b> 8g chất béo </b> mỗi lần phục vụ.Công thức này phục vụ 2. Với <b> $ 1,78 mỗi lần phục vụ </b>, công thức này <b> bao gồm 25%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.<b> Autumn </b> sẽ còn đặc biệt hơn với công thức này.Nó hoạt động tốt như một hor d\'Oeuvre.207 người đã thử và thích công thức này.Nó được mang đến cho bạn bởi Fullbellysisters.blogspot.com.Một hỗn hợp của nước dùng rau, evoo, tỏi, và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này rất ngon.Tất cả những điều được xem xét, chúng tôi đã quyết định công thức này <b> xứng đáng có số điểm thì 96%</b>.Điểm này là nổi bật.Hãy thử <a href = \"https://spoonacular.com/recipes/asparagus-and-pea-soup-real-convenience-food-1393979\"> Súp măng tây và đậu: Thực phẩm tiện lợi thực sự </a>, <Ahref = \"https://spoonacular.com/recipes/asparagus-and-pea-soup-real-convenience-food-1376201\"> súp măng tây và đậu: thực phẩm tiện lợi thực sự </a>, và <ahref = \"https://spoonacular.com/recipes/asparagus-and-pea-soup-real-convenience-food-1362341\"> súp măng tây và đậu: thực phẩm tiện lợi thực sự </a> cho các công thức nấu ăn tương tự.','https://img.spoonacular.com/recipes/716406-312x231.jpg'),(9,'Kale garlicky','Kale garlicky cần khoảng <b> 45 phút </b> từ đầu đến cuối.Món phụ này có <b> 170 calo </b>, <b> 2g protein </b> và <b> 15g chất béo </b> mỗi lần phục vụ.Công thức này phục vụ 2. Với <b> 69 cent mỗi lần phục 