hục vụ 6. Một phần của đĩa này chứa xấp xỉ <b> 18g protein </b>, <b> 6g chất béo </b> và tổng cộng <b> 393 calo </b>.Đối với <b> $ 1,68 mỗi khẩu phần </b>, công thức này <b> bao gồm 33%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.53 người rất vui vì họ đã thử công thức này.Một hỗn hợp của rau, cà chua, hành tây và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này trở nên có hương vị.Đó là một lựa chọn tốt nếu bạn đang theo dõi <b> không có gluten, không có sữa, ăn chay lacto ovo và ăn chay </b>.Công thức này là điển hình của ẩm thực Cajun.Nó được mang đến cho bạn bởi foodandspice.blogspot.com.Từ việc chuẩn bị đến đĩa, công thức này mất khoảng <b> 45 phút </b>.Nhìn chung, công thức này kiếm được số điểm rất lớn <b> 99%</b>.Người dùng thích công thức này cũng thích <a href = \"https://spoonacular.com/recipes/red-kidney-bean-ambalaya-1407231\"Salad </a>, và <a href = \"https://spoonacular.com/recipes/red-kidney-bean-curry-80686\"> cà ri đậu đỏ </a>.','https://img.spoonacular.com/recipes/782601-312x231.jpg'),(12,'Súp lơ, gạo nâu và cơm chiên rau','Công thức súp lơ, gạo nâu và gạo chiên thực vật đã sẵn sàng <b> trong khoảng 30 phút </b> và chắc chắn là một loại gluten tuyệt vời <b> không có gluten, không có sữa, chay lacto ovo và lựa chọn thuần chay </b> cho những người yêu thích thực phẩm Trung Quốc.Công thức này tạo ra 8 phần ăn với <b> 248 calo </b>, <b> 7g protein </b> và <b> 13g chất béo </b> mỗi loại.Đối với <b> $ 1,19 mỗi khẩu phần </b>, công thức này <b> bao gồm 19%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.Nó hoạt động tốt như một hor d\'Oeuvre.3689 người đã thực hiện công thức này và sẽ làm lại.Nó được mang đến cho bạn bởi Fullbellysisters.blogspot.com.Đi đến cửa hàng và nhặt bông cải xanh, dầu nho, hạt vừng và một vài thứ khác để làm cho nó ngày hôm nay.Với một thìa <b> điểm 100%</b>, món ăn này thật tuyệt vời.<a href = \"https://spoonacular.com/recipes/cauliflower-brown-rice-and-vegetable-fried-rice-1230097\"> súp lơ, gạo nâu và gạo chiên thực vật </a>, <ahref = \"https://spoonacular.com/recipes/cauliflower-brown-rice-and-vegetable-fried-rice-1238897\"> súp lơ, gạo nâu và gạo chiên thực vật </a>, và <ahref = \"https://spoonacular.com/recipes/cauliflower-brown-rice-and-vegetable-fried-rice-1403527\"> súp lơ, gạo nâu và gạo chiên rau </a> rất giống với công thức này.','https://img.spoonacular.com/recipes/716426-312x231.jpg'),(13,'Salad quinoa và đậu xanh với cà chua khô và anh đào khô','Cần một món ăn phụ <b> không có gluten, không có sữa và ăn chay </b>?Quinoan và salad đậu xanh với cà chua khô và anh đào khô có thể là một công thức tuyệt vời để thử.Công thức này phục vụ 6 và có giá $ 1,87 mỗi khẩu phần.Một phục vụ chứa <b> 539 calo </b>, <b> 21g protein </b> và <b> 15g chất béo </b>.34 người đã thực hiện công thức này và sẽ làm lại.Đi đến cửa hàng và nhặt mật ong, nước cam, đậu xanh, và một vài thứ khác để làm cho nó ngày hôm nay.Từ việc chuẩn bị đến đĩa, công thức này mất khoảng <b> 45 phút </b>.Nó được mang đến cho bạn bởi foodandspice.blogspot.com.Tính đến tất cả các yếu tố, công thức này <b> kiếm được số điểm thì 99%</b>, rất ngoạn mục.<a href = \"https://spoonacular.com/recipes/chickpea-and-cucumber-salad-with-ared-chries-and-chese-506468\"href = \"https://spoonacular.com/recipes/spinach-quiche-with-sun-ared-tomatoes-923350\"> rau bina với cà chua khô </a>, và <ahref = \"https://spoonacular.com/recipes/quinoa-salad-with-sared-tart-chies-mint-and-feta-in-lemon-sumac-vinaigrette-605087\"','https://img.spoonacular.com/recipes/716004-312x231.jpg'),(14,'Gạo và đậu tự làm dễ dàng','Gạo và đậu tự làm dễ dàng là một khóa học chính phục vụ 2. Một khẩu phần chứa <b> 446 calo </b>, <b> 19g protein </b> và <b> 4g chất béo </b>.Đối với <b> $ 1,06 mỗi lần phục vụ </b>, công thức này <b> bao gồm 26%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.Một hỗn hợp của tùy chọn: nước sốt nóng, cà chua đóng hộp, nước và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này rất ngon.Công thức này từ Cooking2Perfection.blogspot.com có ​​471 người hâm mộ.Đó là một lựa chọn tốt nếu bạn đang theo dõi <b> không có gluten, không có sữa, ăn chay lacto ovo và ăn chay </b>.Từ việc chuẩn bị đến đĩa, công thức này mất khoảng <b> 35 phút </b>.Nhìn chung, công thức này kiếm được số điểm rất lớn <b> 98%</b>.<a href = \"https://spoonacular.com/recipes/easy-homemade-rice-and-beans-1311839\"> Rice và đậu tự làm dễ dàng </a>, <a href = \"https://spoonacular.com/recipeshref = \"https://spoonacular.com/recipes/easy-homemade-rice-and-beans-1230117\"> gạo và đậu tự làm dễ dàng </a> rất giống với công thức này.','https://img.spoonacular.com/recipes/716627-312x231.jpg'),(15,'Súp đậu trắng Tuscan với dầu ô liu và hương thảo','Súp đậu trắng Tuscan với dầu ô liu và hương thảo là <b> không có gluten, không có sữa, ăn chay lacto ovo và công thức thuần chay </b> với 6 phần.Khóa học chính này có <b> 242 calo </b>, <b> 16g protein </b> và <b> 1g chất béo </b> mỗi lần phục vụ.Đối với <b> 50 xu mỗi khẩu phần </b>, công thức này <b> bao gồm 19%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.Nó sẽ là một hit tại sự kiện <b> mùa thu </b> của bạn.22 người tìm thấy công thức này là ngon và thỏa mãn.Đi đến cửa hàng và nhặt dầu ô liu, hương thảo, tỏi, và một vài thứ khác để làm cho nó ngày hôm nay.Nó được mang đến cho bạn bởi Foodista.Từ việc chuẩn bị đến đĩa, công thức này mất khoảng <b> 45 phút </b>.Với một thìa <b> điểm 79%</b>, món ăn này là tốt.Nếu bạn thích công thức này, hãy xem các công thức tương tự: <a href = \"https://spoonacular.com/recipes/white-bean-soup-with-pasta-and-rosemary-oilhref = \"https://spoonacular.com/recipes/tuscan-white-bean-and-fennel-stew-with-orange-and-rosemary-105383\"> Tuscan White Bean và Fennel Stew với Orange và Rosemary </a>href = \"https://spoonacular.com/recipes/tuscan-white-bean-soup-1054940\"> súp đậu trắng Tuscan </a>.','https://img.spoonacular.com/recipes/664147-312x231.jpg'),(16,'Món ăn giòn brussels','Công thức giòn giòn có thể được làm <b> trong khoảng 30 phút </b>.Với <b> $ 1,69 mỗi khẩu phần </b>, bạn nhận được một món ăn phụ phục vụ 4. Một khẩu phần chứa <b> 232 calo </b>, <b> 8g protein </b> và <b> 16g chất béo </b>.Công thức này được yêu thích bởi 26 foodies và đầu bếp.Nó được mang đến cho bạn bởi Foodista.Một hỗn hợp của giấm rượu vang đỏ, quả óc chó, mù tạt Dijon và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này rất ngon.Đó là một lựa chọn tốt nếu bạn đang theo dõi một chế độ ăn chay <b> không có gluten, không có sữa, Paleolithic và Lacto ovo </b>.Tất cả những điều được xem xét, chúng tôi đã quyết định công thức này <b> xứng đáng có số điểm thì 98%</b>.Điểm số này là ngoạn mục.Các công thức nấu ăn tương tự bao gồm <a href = \"https://spoonacular.com/recipes/side-dish-sundays-cacio-e-pepe-russels-sprouts-1146819\"href = \"https://spoonacular.com/recipes/easy-side-dish-roasted-brussels-sprouts-and-rapes-474168\"href = \"https://spoonacular.com/recipes/side-dish-sundays-cacio-e-pepe-russels-sprouts-1385177\"','https://img.spoonacular.com/recipes/640941-312x231.jpg'),(17,'Súp đậu lăng đỏ với thịt gà và củ cải','Súp đậu lăng đỏ với thịt gà và củ cải có thể là một công thức tốt để mở rộng tiết mục khóa học chính của bạn.Công thức này phục vụ 8 và chi phí $ 3,0 mỗi khẩu phần.Một phục vụ chứa <b> 477 calo </b>, <b> 27g protein </b> và <b> 20g chất béo </b>.Nó được mang đến cho bạn bằng màu hồng khi.1866 mọi người đã thử và thích công thức này.Nó có thể được thưởng thức bất cứ lúc nào, nhưng nó đặc biệt tốt cho <b> mùa thu </b>.Từ việc chuẩn bị đến tấm, công thức này mất khoảng <b> 55 phút </b>.Đó là một lựa chọn tốt nếu bạn đang theo chế độ ăn kiêng <b> không có gluten và không có sữa </b>.Đi đến cửa hàng và nhặt muối và hạt tiêu, cà chua đóng hộp, rau mùi tây phẳng, và một vài thứ khác để làm cho nó ngày hôm nay.Nhìn chung, công thức này kiếm được số điểm Spoonacular ngoạn mục là 99%</b>.Nếu bạn thích công thức này, bạn cũng có thể thích các công thức nấu ăn như <a href = \"https://spoonacular.com/recipes/red-lentil-and-chicken-soup-682185\"Súp gà </a>, và <a href = \"https://spoonacular.com/recipes/red-lentil-soup-34121\"> súp đỏ-lentil </a>.','https://img.spoonacular.com/recipes/715415-312x231.jpg'),(18,'Măng tây và Súp đậu: Thức ăn tiện lợi thực sự','Măng tây và súp đậu: Thực phẩm tiện lợi thực sự cần khoảng <b> 20 phút </b> từ đầu đến cuối.Xem hình của bạn?Công thức ăn chay không có gluten, không có sữa, Paleolithic và Lacto OVO này có <b> 217 calo </b>, <b> 11g protein </b> và <b> 8g chất béo </b> mỗi lần phục vụ.Công thức này phục vụ 2. Với <b> $ 1,78 mỗi lần phục vụ </b>, công thức này <b> bao gồm 25%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.<b> Autumn </b> sẽ còn đặc biệt hơn với công thức này.Nó hoạt động tốt như một hor d\'Oeuvre.207 người đã thử và thích công thức này.Nó được mang đến cho bạn bởi Fullbellysisters.blogspot.com.Một hỗn hợp của nước dùng rau, evoo, tỏi, và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này rất ngon.Tất cả những điều được xem xét, chúng tôi đã quyết định công thức này <b> xứng đáng có số điểm thì 96%</b>.Điểm này là nổi bật.Hãy thử <a href = \"https://spoonacular.com/recipes/asparagus-and-pea-soup-real-convenience-food-1393979\"> Súp măng tây và đậu: Thực phẩm tiện lợi thực sự </a>, <Ahref = \"https://spoonacular.com/recipes/asparagus-and-pea-soup-real-convenience-food-1376201\"> súp măng tây và đậu: thực phẩm tiện lợi thực sự </a>, và <ahref = \"https://spoonacular.com/recipes/asparagus-and-pea-soup-real-convenience-food-1362341\"> súp măng tây và đậu: thực phẩm tiện lợi thực sự </a> cho các công thức nấu ăn tương tự.','https://img.spoonacular.com/recipes/716406-312x231.jpg'),(19,'Kale garlicky','Kale garlicky cần khoảng <b> 45 phút </b> từ đầu đến cuối.Món phụ này có <b> 170 calo </b>, <b> 2g protein </b> và <b> 15g chất béo </b> mỗi lần phục vụ.Công thức này phục vụ 2. Với <b> 69 cent mỗi lần phục vụ </b>, công thức này <b> bao gồm 17%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.19 người đã thực hiện công thức này và sẽ làm lại.Công thức này từ Foodista đòi hỏi giấm balsamic, tỏi, cải xoăn xoăn và dầu ô liu.Đó là một lựa chọn tốt nếu bạn đang theo dõi một chế độ ăn chay <b> không có gluten, không có sữa, Paleolithic và Lacto ovo </b>.Với một thìa <b> điểm 99%</b>, món ăn này là nổi bật.Hãy thử <a href = \"https://spoonacular.com/recipes/garlicky-kale-248759\"> Garlicky Kale </a>, <a href = \"https://spoonacularhref = \"https://spoonacular.com/recipes/garlicky-kale-1584523\"> Kale garlicky </a> cho các công thức nấu ăn tương tự.','https://img.spoonacular.com/recipes/644387-312x231.jpg'),(20,'Slow Cooker Beef Stew','Nếu bạn muốn thêm các công thức nấu ăn <b> miễn phí và không có sữa </b> vào hộp công thức của bạn, món thịt bò nấu chậm có thể là một công thức bạn nên thử.Một phục vụ chứa <b> 434 calo </b>, <b> 44g protein </b> và <b> 12g chất béo </b>.Công thức này phục vụ 6 .. với <b> $ 2,7 mỗi lần phục vụ </b>, công thức này <b> bao gồm 45%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.Nó hoạt động tốt nhất như một khóa học chính, và được thực hiện trong khoảng <b> 8 giờ 10 phút </b>.Nếu bạn có hành lá, cà rốt, cần tây và một vài thành phần khác trong tay, bạn có thể làm nó.Công thức này được yêu thích bởi 57 foodies và đầu bếp.<b> Autumn </b> sẽ còn đặc biệt hơn với công thức này.Nó được mang đến cho bạn bằng màu hồng khi.Tính đến tất cả các yếu tố, công thức này <b> kiếm được số điểm thì 99%</b>, điều này thật tuyệt vời.Các công thức nấu ăn tương tự bao gồm <a href = \"https://spoonacular.com/recipes/slow-cooker-beef-stew-1578321\"> smef cooker stef Stew </a>, <a href = \"https://spoonacular.comhref = \"https://spoonacular.com/recipes/slow-cooker-beef-stew-1281171\"> Stow Cooker Beef Stew </a>.','https://img.spoonacular.com/recipes/715446-312x231.jpg'),(21,'Hậu đỏ bean jambalaya','Bean bean red jambalayan là một khóa học chính phục vụ 6. Một phần của đĩa này chứa xấp xỉ <b> 18g protein </b>, <b> 6g chất béo </b> và tổng cộng <b> 393 calo </b>.Đối với <b> $ 1,68 mỗi khẩu phần </b>, công thức này <b> bao gồm 33%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.53 người rất vui vì họ đã thử công thức này.Một hỗn hợp của rau, cà chua, hành tây và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này trở nên có hương vị.Đó là một lựa chọn tốt nếu bạn đang theo dõi <b> không có gluten, không có sữa, ăn chay lacto ovo và ăn chay </b>.Công thức này là điển hình của ẩm thực Cajun.Nó được mang đến cho bạn bởi foodandspice.blogspot.com.Từ việc chuẩn bị đến đĩa, công thức này mất khoảng <b> 45 phút </b>.Nhìn chung, công thức này kiếm được số điểm rất lớn <b> 99%</b>.Người dùng thích công thức này cũng thích <a href = \"https://spoonacular.com/recipes/red-kidney-bean-ambalaya-1407231\"Salad </a>, và <a href = \"https://spoonacular.com/recipes/red-kidney-bean-curry-80686\"> cà ri đậu đỏ </a>.','https://img.spoonacular.com/recipes/782601-312x231.jpg'),(22,'Súp lơ, gạo nâu và cơm chiên rau','Công thức súp lơ, gạo nâu và gạo chiên thực vật đã sẵn sàng <b> trong khoảng 30 phút </b> và chắc chắn là một loại gluten tuyệt vời <b> không có gluten, không có sữa, chay lacto ovo và lựa chọn thuần chay </b> cho những người yêu thích thực phẩm Trung Quốc.Công thức này tạo ra 8 phần ăn với <b> 248 calo </b>, <b> 7g protein </b> và <b> 13g chất béo </b> mỗi loại.Đối với <b> $ 1,19 mỗi khẩu phần </b>, công thức này <b> bao gồm 19%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.Nó hoạt động tốt như một hor d\'Oeuvre.3689 người đã thực hiện công thức này và sẽ làm lại.Nó được mang đến cho bạn bởi Fullbellysisters.blogspot.com.Đi đến cửa hàng và nhặt bông cải xanh, dầu nho, hạt vừng và một vài thứ khác để làm cho nó ngày hôm nay.Với một thìa <b> điểm 100%</b>, món ăn này thật tuyệt vời.<a href = \"https://spoonacular.com/recipes/cauliflower-brown-rice-and-vegetable-fried-rice-1230097\"> súp lơ, gạo nâu và gạo chiên thực vật </a>, <ahref = \"https://spoonacular.com/recipes/cauliflower-brown-rice-and-vegetable-fried-rice-1238897\"> súp lơ, gạo nâu và gạo chiên thực vật </a>, và <ahref = \"https://spoonacular.com/recipes/cauliflower-brown-rice-and-vegetable-fried-rice-1403527\"> súp lơ, gạo nâu và gạo chiên rau </a> rất giống với công thức này.','https://img.spoonacular.com/recipes/716426-312x231.jpg'),(23,'Salad quinoa và đậu xanh với cà chua khô và anh đào khô','Cần một món ăn phụ <b> không có gluten, không có sữa và ăn chay </b>?Quinoan và salad đậu xanh với cà chua khô và anh đào khô có thể là một công thức tuyệt vời để thử.Công thức này phục vụ 6 và có giá $ 1,87 mỗi khẩu phần.Một phục vụ chứa <b> 539 calo </b>, <b> 21g protein </b> và <b> 15g chất béo </b>.34 người đã thực hiện công thức này và sẽ làm lại.Đi đến cửa hàng và nhặt mật ong, nước cam, đậu xanh, và một vài thứ khác để làm cho nó ngày hôm nay.Từ việc chuẩn bị đến đĩa, công thức này mất khoảng <b> 45 phút </b>.Nó được mang đến cho bạn bởi foodandspice.blogspot.com.Tính đến tất cả các yếu tố, công thức này <b> kiếm được số điểm thì 99%</b>, rất ngoạn mục.<a href = \"https://spoonacular.com/recipes/chickpea-and-cucumber-salad-with-ared-chries-and-chese-506468\"href = \"https://spoonacular.com/recipes/spinach-quiche-with-sun-ared-tomatoes-923350\"> rau bina với cà chua khô </a>, và <ahref = \"https://spoonacular.com/recipes/quinoa-salad-with-sared-tart-chies-mint-and-feta-in-lemon-sumac-vinaigrette-605087\"','https://img.spoonacular.com/recipes/716004-312x231.jpg'),(24,'Gạo và đậu tự làm dễ dàng','Gạo và đậu tự làm dễ dàng là một khóa học chính phục vụ 2. Một khẩu phần chứa <b> 446 calo </b>, <b> 19g protein </b> và <b> 4g chất béo </b>.Đối với <b> $ 1,06 mỗi lần phục vụ </b>, công thức này <b> bao gồm 26%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.Một hỗn hợp của tùy chọn: nước sốt nóng, cà chua đóng hộp, nước và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này rất ngon.Công thức này từ Cooking2Perfection.blogspot.com có ​​471 người hâm mộ.Đó là một lựa chọn tốt nếu bạn đang theo dõi <b> không có gluten, không có sữa, ăn chay lacto ovo và ăn chay </b>.Từ việc chuẩn bị đến đĩa, công thức này mất khoảng <b> 35 phút </b>.Nhìn chung, công thức này kiếm được số điểm rất lớn <b> 98%</b>.<a href = \"https://spoonacular.com/recipes/easy-homemade-rice-and-beans-1311839\"> Rice và đậu tự làm dễ dàng </a>, <a href = \"https://spoonacular.com/recipeshref = \"https://spoonacular.com/recipes/easy-homemade-rice-and-beans-1230117\"> gạo và đậu tự làm dễ dàng </a> rất giống với công thức này.','https://img.spoonacular.com/recipes/716627-312x231.jpg'),(25,'Súp đậu trắng Tuscan với dầu ô liu và hương thảo','Súp đậu trắng Tuscan với dầu ô liu và hương thảo là <b> không có gluten, không có sữa, ăn chay lacto ovo và công thức thuần chay </b> với 6 phần.Khóa học chính này có <b> 242 calo </b>, <b> 16g protein </b> và <b> 1g chất béo </b> mỗi lần phục vụ.Đối với <b> 50 xu mỗi khẩu phần </b>, công thức này <b> bao gồm 19%</b> các yêu cầu hàng ngày của bạn về vitamin và khoáng chất.Nó sẽ là một hit tại sự kiện <b> mùa thu </b> của bạn.22 người tìm thấy công thức này là ngon và thỏa mãn.Đi đến cửa hàng và nhặt dầu ô liu, hương thảo, tỏi, và một vài thứ khác để làm cho nó ngày hôm nay.Nó được mang đến cho bạn bởi Foodista.Từ việc chuẩn bị đến đĩa, công thức này mất khoảng <b> 45 phút </b>.Với một thìa <b> điểm 79%</b>, món ăn này là tốt.Nếu bạn thích công thức này, hãy xem các công thức tương tự: <a href = \"https://spoonacular.com/recipes/white-bean-soup-with-pasta-and-rosemary-oilhref = \"https://spoonacular.com/recipes/tuscan-white-bean-and-fennel-stew-with-orange-and-rosemary-105383\"> Tuscan White Bean và Fennel Stew với Orange và Rosemary </a>href = \"https://spoonacular.com/recipes/tuscan-white-bean-soup-1054940\"> súp đậu trắng Tuscan </a>.','https://img.spoonacular.com/recipes/664147-312x231.jpg'),(26,'Món ăn giòn brussels','Công thức giòn giòn có thể được làm <b> trong khoảng 30 phút </b>.Với <b> $ 1,69 mỗi khẩu phần </b>, bạn nhận được một món ăn phụ phục vụ 4. Một khẩu phần chứa <b> 232 calo </b>, <b> 8g protein </b> và <b> 16g chất béo </b>.Công thức này được yêu thích bởi 26 foodies và đầu bếp.Nó được mang đến cho bạn bởi Foodista.Một hỗn hợp của giấm rượu vang đỏ, quả óc chó, mù tạt Dijon và một số ít các thành phần khác là tất cả những gì cần thiết để làm cho công thức này rất ngon.Đó là một lựa chọn tốt nếu bạn đang theo dõi một chế độ ăn chay <b> không có gluten, không có sữa, Paleolithic và Lacto ovo </b>.Tất cả những điều được xem xét, chúng tôi đã quyết định công thức này <b> xứng đáng có số điểm thì 98%</b>.Điểm số này là ngoạn mục.Các công thức nấu ăn tương tự bao gồm <a href = \"https://spoonacular.com/recipes/side-dish-sundays-cacio-e-pepe-russels-sprouts-1146819\"href = \"https://spoonacular.com/recipes/easy-side-dish-roasted-brussels-sprouts-and-rapes-474168\"href = \"https://spoonacular.com/recipes/side-dish-sundays-cacio-e-pepe-russels-sprouts-1385177\"','https://img.spoonacular.com/recipes/640941-312x231.jpg');
